  - uid: 'excel!Excel.createWorkbook:function(1)'
    summary: |-
      Creates and opens a new workbook. Optionally, the workbook can be pre-populated with a base64-encoded .xlsx file.

      \[ [API set: ExcelApi 1.8](/office/dev/add-ins/reference/requirement-sets/excel-api-requirement-sets) \]
    name: Excel.createWorkbook(base64)
    fullName: Excel.createWorkbook(base64)
    langs:
      - typeScript
    type: function
    syntax:
      content: 'export function createWorkbook(base64?: string): Promise<void>;'
      return:
        type:
          - 'excel!Excel.createWorkbook~0:complex'
        description: |-


          #### Examples

          ```javascript
          var myFile = document.getElementById("file");
          var reader = new FileReader();

          reader.onload = function (event) {
              // strip off the metadata before the base64-encoded string
              var startIndex = event.target.result.indexOf("base64,");
              var copyBase64 = event.target.result.substr(startIndex + 7);

              Excel.createWorkbook(copyBase64);        
          };

          // read in the file as a data URL so we can parse the base64-encoded string
          reader.readAsDataURL(myFile.files[0]);
          ```
      parameters:
        - id: base64
          description: ''
          type:
            - string
